import Paragraph from './Paragraph';
const Button = (props) => {
	const {buttonText, onClickFunction} = props;
	return (
		  <button style={{color: 'pink', backgroundColor: 'maroon'}} onClick={onClickFunction}>{buttonText}</button>
	);
};

function App() {
  return (
    <div>
     <Paragraph text={'Phillepe'}/>
     <Paragraph text={'Porthos'}/>
     <Paragraph text={'Athos'}/>
     <Paragraph text={'Aremous'}/>
     <Button buttonText={'Click Me!'} onClickFunction={() => alert('You clicked this button!')}/>
     <Button buttonText={'Click This!'} onClickFunction={() => alert('You clicked a different button!')}/>
    </div>
  );
}

export default App;
